using BenchmarkDotNet.Attributes;
using System;

namespace test;

public class bench_stupid
{
    private LongField _ = new();
    private ShortField _shortFields = new();

    [GlobalSetup]
    public void Setup()
    {
        _shortFields.A = Random.Shared.Next();
        _. = _shortFields.A;
        _shortFields.I = Random.Shared.Next();
        _. = _shortFields.I;
    }

    [Benchmark]
    public int short_name()
    {
        _shortFields.A += _shortFields.I;
        _shortFields.A *= _shortFields.I;
        _shortFields.A += _shortFields.I;
        _shortFields.A *= _shortFields.I;

        _shortFields.A += _shortFields.I;
        _shortFields.A *= _shortFields.I;
        _shortFields.A += _shortFields.I;
        _shortFields.A *= _shortFields.I;

        _shortFields.A += _shortFields.I;
        _shortFields.A *= _shortFields.I;
        return _shortFields.A;
    }


    [Benchmark]
    public int long_name()
    {
        _. += _.;
        _. *= _.;
        _. += _.;
        _. *= _.;

        _. += _.;
        _. *= _.;
        _. += _.;
        _. *= _.;

        _. += _.;
        _. *= _.;

        return _.;
    }
}
public class ShortField
{
    public int A;
    public int I;
}
public class LongField
{
    public int ;
    public int ;
}
